--
-- 数据库: `iwei`
--

-- --------------------------------------------------------

--
-- 表的结构 `aiw_dd`
--

CREATE TABLE IF NOT EXISTS `aiw_dd` (
  `id` varchar(30) NOT NULL COMMENT '方便人眼识别，无实际用途',
  `guid` varchar(100) NOT NULL,
  `title` varchar(250) NOT NULL COMMENT '标题',
  `fulltitle` varchar(250) DEFAULT NULL COMMENT '全称',
  `val` varchar(250) DEFAULT NULL COMMENT '值',
  `beizhu` text COMMENT '备注',
  `val2` varchar(250) DEFAULT NULL COMMENT '备用',
  `beizhu2` text COMMENT 'val2备注',
  `val3` varchar(250) DEFAULT NULL COMMENT '备用',
  `beizhu3` text COMMENT 'val3备注',
  `val4` varchar(250) DEFAULT NULL COMMENT '备用',
  `beizhu4` text COMMENT 'val4备注',
  `val5` varchar(250) DEFAULT NULL COMMENT '备用',
  `beizhu5` text COMMENT 'val5备注',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_user` varchar(100) DEFAULT NULL,
  `update_user` varchar(100) DEFAULT NULL,
  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `del_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `del_user` varchar(100) DEFAULT NULL,
  `isdel` tinyint(4) DEFAULT '0',
  `can_del` tinyint(4) DEFAULT '0' COMMENT '0:不能删除,1:能删。如果不能删除，删除按钮只开放给超管',
  `parent_guid` varchar(100) DEFAULT NULL COMMENT '父ID',
  `parent_path` text COMMENT '用,隔开的 父ID的路径',
  `del_roles` varchar(250) DEFAULT NULL COMMENT '能删当前节点的角色，用","隔开,无值代表不限制',
  `edit_roles` varchar(250) DEFAULT NULL COMMENT '能修改当前节点的角色，用","隔开,无值代表不限制',
  `add_roles` varchar(250) DEFAULT NULL COMMENT '能新增当前节点的角色，用","隔开,无值代表不限制',
  `icon` varchar(50) DEFAULT NULL COMMENT '节点的图标',
  `sort` smallint(6) DEFAULT '1000' COMMENT '排序从小到大',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='数据字典';

