--
-- 表的结构 `aiw_err_log`
--

CREATE TABLE IF NOT EXISTS `aiw_err_log` (
  `guid` varchar(250) NOT NULL,
  `errno` varchar(100) NOT NULL COMMENT '包含了错误的级别，是一个 integer。',
  `errstr` text COMMENT '包含了错误的信息，是一个 string。',
  `errfile` text COMMENT ' 包含了发生错误的文件名，是一个 string。',
  `errline` varchar(50) DEFAULT NULL COMMENT '包含了错误发生的行号，是一个 integer。',
  `errcontext` text COMMENT ' 是一个指向错误发生时活动符号表的 array。 也就是说，errcontext 会包含错误触发处作用域内所有变量的数组。 用户的错误处理程序不应该修改错误上下文（context）。',
  `beizhu` text COMMENT '描述',
  `createdate` int(11) DEFAULT NULL,
  `sys_user_guid` varchar(250) DEFAULT NULL,
  `sys_user_username` varchar(50) DEFAULT NULL COMMENT '用户登录名',
  PRIMARY KEY (`guid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='php出错日志，通过config.php控制是否打开';

