--
-- 表的结构 `aiw_files`
--

CREATE TABLE IF NOT EXISTS `aiw_files` (
  `guid` varchar(255) NOT NULL,
  `title` varchar(255) DEFAULT NULL COMMENT '文件标题',
  `filepath` varchar(255) DEFAULT NULL COMMENT '文件所在目录',
  `filename` varchar(250) DEFAULT NULL COMMENT '只是文件名',
  `fullfilename` varchar(255) DEFAULT NULL COMMENT '包含路径的文件名',
  `filesize` bigint(20) DEFAULT '0' COMMENT '字节数',
  `mime` varchar(50) DEFAULT NULL COMMENT '文件的MIME类型',
  `can_del` smallint(255) DEFAULT '1' COMMENT '0：不能删除',
  `create_user` varchar(255) DEFAULT NULL COMMENT '上传人的GUID',
  `create_date` datetime DEFAULT NULL,
  `update_user` varchar(255) DEFAULT NULL COMMENT '更新人GUID',
  `update_date` datetime DEFAULT NULL,
  `del_user` varchar(255) DEFAULT NULL COMMENT '删除人GUID',
  `del_date` datetime DEFAULT NULL,
  `isdel` enum('1','0') DEFAULT '0',
  `sys_module_guid` varchar(255) DEFAULT NULL COMMENT '模块GUID',
  `upload_setup_guid` varchar(255) DEFAULT NULL COMMENT '上传设置表的GUID',
  `parent_guid` varchar(200) DEFAULT NULL COMMENT '父GUID,用于记录附加生成的文件，如：缩略图',
  `image_width` int(11) DEFAULT '0',
  `image_height` int(11) DEFAULT NULL,
  PRIMARY KEY (`guid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='上传文件';

