--
-- 表的结构 `aiw_opt_log`
--

CREATE TABLE IF NOT EXISTS `aiw_opt_log` (
  `guid` varchar(100) NOT NULL,
  `opt_flag` varchar(100) NOT NULL COMMENT '操作标识(读取模块表中控制器方法名，对应则显示名称) ',
  `post_data` text COMMENT '提交的数据',
  `get_data` text COMMENT '网址参数',
  `request_data` text COMMENT '通用数据',
  `url` varchar(250) DEFAULT NULL COMMENT '操作网址',
  `beizhu` text COMMENT '描述',
  `createdate` int(11) DEFAULT NULL,
  `sys_user_guid` varchar(250) DEFAULT NULL,
  `sys_user_username` varchar(50) DEFAULT NULL COMMENT '用户登录名',
  `err_guid` varchar(100) DEFAULT NULL COMMENT '如果操作出错，日志管理到出错日志',
  PRIMARY KEY (`guid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='系统操作日志，建议自动执行';

