--
-- 表的结构 `aiw_sys_module`
--

CREATE TABLE IF NOT EXISTS `aiw_sys_module` (
  `guid` varchar(100) NOT NULL,
  `id` varchar(30) NOT NULL COMMENT '用于肉眼查看，没有实际用途',
  `title` varchar(100) NOT NULL,
  `beizhu` text COMMENT '适当说明一下',
  `collapsed` tinyint(4) DEFAULT '0' COMMENT '是否收缩，默认0 不收缩',
  `dd_icon` varchar(250) DEFAULT NULL COMMENT '模块的图标 读数据字典',
  `controller` varchar(250) DEFAULT NULL COMMENT '控制器',
  `method` varchar(250) DEFAULT NULL COMMENT '方法名',
  `param` varchar(250) DEFAULT NULL COMMENT '网址参数，写问号以后的内容',
  `url` varchar(250) DEFAULT NULL COMMENT '当菜单 或 特别处理 时需要指定链接 ',
  `urltype` tinyint(4) DEFAULT '0' COMMENT '0内链，1外链',
  `url_target` varchar(50) DEFAULT NULL COMMENT '_blank 新TAB窗口打开 _self 当前页面 _layerbox 弹层',
  `up_share` enum('0','1') DEFAULT '0' COMMENT '创建人的信息是否被上级看到',
  `up_edit` enum('0','1') DEFAULT '0' COMMENT '创建人的信息上级是否能修改',
  `up_del` enum('0','1') DEFAULT '0' COMMENT '创建人的信息上级能否删除',
  `isdel` enum('0','1') DEFAULT '0',
  `deldate` int(11) DEFAULT '0',
  `deluser` varchar(250) DEFAULT NULL,
  `createdate` int(11) DEFAULT '0',
  `createuser` varchar(250) DEFAULT NULL,
  `updatedate` int(11) DEFAULT '0',
  `updateuser` varchar(250) DEFAULT NULL,
  `module_type` smallint(6) DEFAULT '0' COMMENT '10：菜单 20：顶部按钮 30：表单按钮 40：字段 50：列表按钮 60:方法函数',
  `parent_guid` varchar(100) DEFAULT NULL COMMENT '父记录',
  `parent_path` text COMMENT '路径,隔开',
  `curr_level` smallint(6) DEFAULT '0' COMMENT '当前层数，就是读出路径个数parent_path',
  `sort` smallint(6) DEFAULT '100' COMMENT '从小到大',
  PRIMARY KEY (`guid`,`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用于设置菜单 、按钮、处理';

